description:
Can you reclaim your ancestors' land? Evil forces have taken over the once fertile land of Fortiana You are the only one who can storm the castles and claw it back from the hordes of dragons. Experience a new type of strategy and arcade game. Fence off parts of the battlefield to corner your enemies Collect catapults and power-ups to besiege the fortresses and take on dragons. But beware! As you progress through the levels it gets harder and
harder. The fortresses become much larger and the monsters more vicious. Can you emerge victorious and reclaim the land of your ancestors? You are
knight Fortix, the sole hope for the desolate and tortured land of Fortiana to become the fertile land that it was before.

